import React, { Component } from "react";
import { TextField, Container, Button } from "@material-ui/core";
import { url } from "inspector";

class Login extends Component {
  render() {
    return (
      <div
        style={{
          backgroundImage: url(
            "https://milaco.vn/wp-content/uploads/2018/10/website-login-background.jpg"
          )
        }}
      >
        <h3>LOGIN</h3>
        <Container>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="standard"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="standard"
            type="password"
          />
          <br />
          <Button
            onClick={() => {
              console.log("AA");
            }}
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}

export default Login;
